import React from "react";

export const cardStyle = {
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  padding: "20px",
  border: "1px solid #ccc",
  borderRadius: "4px",
  marginBottom: "20px",
};

export const avatarStyle = {
  width: "100px",
  height: "100px",
  borderRadius: "50%",
  marginBottom: "10px",
};

export const buttonStyle = {
  padding: "10px 20px",
  backgroundColor: blue,
  color: "#fff",
  border: "none",
  borderRadius: "4px",
  cursor: "pointer",
};
